import './CV.css';
import GATE_Team from "./GATE_Team.jpg";

import React from 'react'

export default function GATE_AFM() {
    return (
        <>
        <div>
            <div className="vertical_space"/>
                <div className="row">
                        <div className="column">
                            <h3 className="title">GATE - AFM Telethon</h3>
                            &nbsp; 
                            <h4>
                                GATE stands in English for "Managing and Learning to Work in Teams".
                            </h4>
                        </div>
                            <img className="fgb" src={GATE_Team} width="400" height="300" alt="GATE Team" />
                        </div>
                </div>
                <div className="vertical_space"/>
        </>
    )
}
